// src/QGIS.js
import React from 'react';

const QGIS = ({ onBack }) => {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>QGIS Map</h1>
            {/* Display your QGIS images here */}
            <img src="hrv.png" alt="QGIS Example 1" style={{ width: '500px', margin: '10px' }} />
            <img src="stress.png" alt="QGIS Example 2" style={{ width: '500px', margin: '10px' }} />
            <img src="hrv.png" alt="QGIS Example 1" style={{ width: '500px', margin: '10px' }} />
            <img src="stress.png" alt="QGIS Example 2" style={{ width: '500px', margin: '10px' }} />
            {/* Add more images as needed */}
            <br />
            <button onClick={onBack} style={{ padding: '10px 20px', fontSize: '16px', marginTop: '20px' }}>
                Back
            </button>
        </div>
    );
};

export default QGIS;
